import React, { useEffect } from 'react';
import axios from 'axios';

function Googlemap() {
  useEffect(() => {
    var config = {
      url: `https://maps.googleapis.com/maps/api/directions/json?origin=Boston%2C%20MA&destination=Concord%2C%20MA&waypoints=via%3ACharlestown%2CMA%7Cvia%3ALexington%2CMA&departure_time=now&key=AIzaSyAyZffxPv5S2NP2NEp_31-HH9XmDwSEWbM`,
      headers: {}
    };

    axios(config)
      .then(function (response) {
        console.log(JSON.stringify(response.data));
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  return (
    <div>
      {/* Add your Google Map rendering JSX code here */}
    </div>
  );
}

export default Googlemap;
